// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";

/*
    Things we are doing in this contract:
    Send funds.
    Withdraw funds.
    Set Minimum funding value in USD
*/
contract FundMe{
    uint256 public minimumUSD = 10 * 1e18;
    address[] public funders;
    mapping(address=>uint256) public addressToAmountFunded; 
    function fund() public payable  {
        /* Here i want to able to set the minimum fund in USD
            1.How do we send Eth to this contract. "There's a value field in the EVM from there we can enter the amount of Eth
            that need to be sent"
            In order to access the value we can use "msg.value" here we can get the amount of Eth that the User is sending
            We can also set a limit that minimum of this amount of Eth should be sent by using the function require(msg.value>1e18) something like this.
            it checks the amount if it satisties the requirement the okay otherwise the whole function is reverted back and undo the whole process and,
            send the remaining gas back...
            2.Inorder to get the price of 1 Eth in USD we have to use some decentralised network like chainlink or the oracle.
        */
        require(getConversionRate(msg.value) >= minimumUSD, "Didn't send enough");
        addressToAmountFunded[msg.sender] = msg.value;
        funders.push(msg.sender);
    }

    function getPrice() public view returns (uint256) {
        /*
        Since this function is instance of us interating with the contract outside of our project so we need the Address and ABI
        in order to interact with the external data.
         Address(to convert the Eth to USD): 0x694AA1769357215DE4FAC081bf1f309aDC325306
         NOTE: ABI is required to interact with the external data solidity also provides us an option to call functions from another contract without haiving the ABI,
         i.e by using the interfaces like  "AggregatorV3Interface(0xYourPriceFeedAddress);" this.
        */
        AggregatorV3Interface priceFeed = AggregatorV3Interface(0x694AA1769357215DE4FAC081bf1f309aDC325306);
        // (uint256 roundId, int price, uint startedAt, uint timeStamp, uint80 answeredInRound) = priceFeed.latestRoundData();
        (,int256 price,,,) = priceFeed.latestRoundData();
        return uint256(price * 1e10); // price is 8 decimals, converting it to 18 decimals
    }

    function getVersion() public view returns (uint256){
        AggregatorV3Interface priceFeed = AggregatorV3Interface(0x694AA1769357215DE4FAC081bf1f309aDC325306);
        return priceFeed.version();
    }

    function getConversionRate(uint256 ethAmt) public view returns (uint256){
        uint256 ethPrice = getPrice(); // ETH/USD price with 18 decimals
        uint256 EthAmmountInUSD = (ethPrice * ethAmt) / 1e18; // Converts ETH amount to USD (18 decimals)
        return EthAmmountInUSD;
    }

    // function withdraw()  {}
}

